import React from 'react';

function* fetchData(){
    const uri = 'https://jsonplaceholder.typicode.com/posts/1';
    const response = yield fetch(uri);
    yield console.log(response);
}
const GeneratorExamples = ()=> {
    let f = fetchData()();
    f.next();
    
    return (
        <div>
            Gnerator examples
        </div>
    )
};
export default GeneratorExamples;
